window.bookSummaryJSON = "<p><b>He wants to ruin her. She wants to save him.</b></p> <p>Hadley Rexford was a distraction I didn’t need. But when she discovers me with blood on my hands, I know I can’t walk away without demanding her silence. I’ll taint her. Torment her. In the end, I’ll ruin her.</p> <p>Cole Jagger was a puzzle I wanted to solve. But he refuses to let me in, and now I’m ensnared in his trap. He’s cold. Immoral. In the end, he‘ll break me.</p> <p>She might think I’m worthy of salvation, but I’m on a one way trip straight to hell, and if she’s not careful. I’ll drag her right along with me.</p> <p><b><i>Taint Her</i></b><b> is a dark high school bully romance.</b></p>"; 
